<!DOCTYPE html>
<html xmlns:t="http://twistedmatrix.com/ns/twisted.web.template/0.1">
  <meta name="pydoctor-template-version" content="2" />

  <t:transparent t:render="head">Head</t:transparent>

  <body>

    <div t:render="header" />

    <nav class="navbar navbar-default mainnavbar">
      <t:transparent t:render="nav" /></nav>

    <div class="container-fluid">

      <div class="page-header">
        <h1>Nebius API Reference</h1>
        <div id="showPrivate">
          <button class="btn btn-link" onclick="togglePrivate()">Toggle system units</button>
        </div>
      </div>

      <h2>Clients</h2>
      <div class="nebius-clients may-have-privates" t:render="clients">
      </div>
    </div>

    <div class="container-fluid" t:render="footer" />

    <script src="pydoctor.js" type='text/javascript'></script>

  </body>
</html>
